import { useEffect, useState } from "react"

function Api(){
    const [logeData, setData] = useState({})

    const getData = () =>{
        fetch('data/data.json')
        .then((res) => res.json())
        .then((logeData) => setData(logeData))
    }

useEffect(() => {
    getData()
},[])
}

export default Api
